import './App.css';
import rat from './img/짭쥐 표지-15.png';
import cat from './img/짭쥐 표지-16.png';
import img2 from './img/짭쥐 표지-17.png';
import img3 from './img/짭쥐 표지-18.png';
import img4 from './img/짭쥐 표지-19.png';

function App() {
  return (
    <div className='app'>
      {/* 첫페이지 */}
      <div> 
        <img className='firstpage' src={img2}/>
        <img className='firstpage' src={img3}/>
        <img className='firstpage' src={img4}/>
        <img className='firstpage' src={cat}/>
        <img className='firstpage' src={rat}/>
      </div>
      {/* 아이콘 페이지 */}

    </div>
  );
}

export default App;
